from collections import Counter
class Solution:
    def minSteps( s: str, t: str) -> int:
        available = set(t).difference(set(s))
        av = 0
        for i in available:
            av+=t.count(i)
        sc = Counter(s)
        tc = Counter(t)
        repl=0
        for i in sc:
            if i in tc:
                if sc[i]>=tc[i]:
                    repl+=sc[i]-tc[i]
                    # print(i,repl,"if")
            else:
                repl+=sc[i]
                av-=sc[i]
                # print(i,repl,"3if")
        return repl
    print(minSteps( s = "", t = ""))
